--
-- Name: sprawdz_wczhodzacego_zmiany(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sprawdz_wczhodzacego_zmiany() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    moj_turniej turnieje%ROWTYPE;
    moj_zespol INT;
BEGIN
    SELECT * INTO moj_turniej FROM turnieje WHERE id=NEW.id_turnieju;
    moj_zespol = znajdz_zespol_gracza(NEW.id_wchodzacego, NEW.id_turnieju);
    IF  (SELECT TRUE
         FROM sklady_w_zespolach
         WHERE id_turnieju=NEW.id_turnieju
         AND id_osoby=NEW.id_wchodzacego
         AND (rola!=3 OR id_zespolu!=moj_zespol))

        OR

        (SELECT TRUE
         FROM sklady_w_zespolach swz
         JOIN turnieje t ON swz.id_turnieju=t.id
         WHERE swz.id_turnieju!=NEW.id_turnieju
         AND swz.id_osoby=NEW.id_wchodzacego
         AND (moj_turniej.data_startu BETWEEN t.data_startu AND t.data_konca
            OR moj_turniej.data_konca BETWEEN t.data_startu AND t.data_konca)) 
        
        OR

        (SELECT TRUE
         FROM zmiany
         WHERE id_wchodzacego=NEW.id_wchodzacego
         AND id_turnieju=NEW.id_turnieju) 
         
        OR

        (SELECT TRUE
         FROM zmiany z
         JOIN turnieje t ON z.id_turnieju=t.id
         WHERE z.id_turnieju!=NEW.id_turnieju
         AND z.id_wchodzacego=NEW.id_wchodzacego
         AND (moj_turniej.data_startu BETWEEN t.data_startu AND t.data_konca
            OR moj_turniej.data_konca BETWEEN t.data_startu AND t.data_konca))
    THEN
        RAISE EXCEPTION 'Wchodzacy o id % już gra w turnieju(może w innym czasie)', NEW.id_wchodzacego;
    END IF;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.sprawdz_wczhodzacego_zmiany() OWNER TO postgres;

--
-- Name: sprawdz_wczodzacy_zarejestrowany(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sprawdz_wczodzacy_zarejestrowany() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF NOT EXISTS (SELECT * FROM sklady_w_zespolach
                   WHERE id_turnieju=NEW.id_turnieju AND id_osoby=NEW.id_wchodzacego AND rola=3)
    THEN
        RAISE EXCEPTION 'Osoba o id % nie jest zarejestrowana jako gracz zapasowy', NEW.id_wchodzacego;
    END IF;
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.sprawdz_wczodzacy_zarejestrowany() OWNER TO postgres;

--
-- Name: sprawdz_zchodzacego_zmiany(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.sprawdz_zchodzacego_zmiany() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF (SELECT TRUE 
        FROM sklady_w_zespolach
        WHERE id_turnieju=NEW.id_turnieju
        AND id_osoby=NEW.id_zchodzacego
        ) IS NULL
    THEN 
        RAISE EXCEPTION 'Zchodzacy o id % nie gra w turnieju o id %', NEW.id_zchodzacego, NEW.id_turnieju;
    END IF;
    RETURN NEW;
END;
$$;


