-- Name: usun_uczestnika(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.usun_uczestnika(id_u integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
BEGIN
    UPDATE uczestnicy 
    SET imie = '', nazwisko = '', data_urodzenia = CURRENT_DATE
    WHERE id = id_u;
    
    RETURN FOUND;
END;
$$;


